  const {todos} = useContext(TodoContext);
  // const [count, setCount] = useState(0);
  // setCount(count);
  return(
    <div className="navbar">
      <h1>Todo App</h1>
      <p>Total of your todos is {todos.length}</p>
    </div>
  )
}

export default Navbar;
